import React, { Component } from 'react'
import { Link } from 'react-router-dom';
import { Card, CardImg, CardBody, Button, Container, ListGroup, ListGroupItem,
    CardTitle, CardSubtitle, Row, Col,  Badge, Media} from 'reactstrap';
import AddImage from '../Image/addimage.png';

import AddDescription from '../Image/adddescription.png';
import AddYourProduct from '../Image/addyourproduct.png';

export default class AddMedia extends Component {

  render() {
    return (
      <div style={{  width: '1440px',
        height: '1621px',
        backgroundColor: '#f2f2f2'
       }}>
      <ListGroup>
        <ListGroupItem style={{fontFamily: 'Roboto',
  fontSize: '18px',
  fontWeight: 'normal',
  fontStyle: 'normal',
  fontStretch: 'normal',
  lineHeight: 'normal',
  letterSpacing: 'normal',
  color: '#838383'}}

        disabled tag="a" href="#">AddMedia</ListGroupItem>
        <ListGroupItem style={{fontFamily: 'Roboto',
  fontSize: '18px',
  fontWeight: 'normal',
  fontStyle: 'normal',
  fontStretch: 'normal',
  lineHeight: 'normal',
  letterSpacing: 'normal',
  color: '#ffffff'}}

        tag="a" href="#" src={AddImage} >Add Image</ListGroupItem>
        <ListGroupItem style={{fontFamily: 'Roboto',
  fontSize: '18px',
  fontWeight: 'normal',
  fontStyle: 'normal',
  fontStretch: 'normal',
  lineHeight: 'normal',
  letterSpacing: 'normal',
  color: '#ffffff'}}

        tag="a" href="#" src={AddDescription} >Add Description</ListGroupItem>
        <ListGroupItem style={{fontFamily: 'Roboto',
  fontSize: '18px',
  fontWeight: 'normal',
  fontStyle: 'normal',
  fontStretch: 'normal',
  lineHeight: 'normal',
  letterSpacing: 'normal',
  color: '#ffffff'}}

        tag="a" href="#" src={AddYourProduct} >Add Your Product</ListGroupItem>

      </ListGroup>
      </div>
    )
  }
}
